import React from "react";
import "./App.css";
import { Route } from "react-router-dom";
import HomePage from "./pages/homepage/homepage";

const HatsPage = () => (
  <div>
    <h2>sdadsf</h2>
  </div>
);
function App() {
  return (
    <div>
      {/* <HomePage /> */}
      <Route path="/" exact component={HomePage} />
      <Route path="/hats" exact component={HatsPage} />
    </div>
  );
}

export default App;
